@kokoinkorea TW dieting

1- I love this for you

2- I keep seeing “recipes” calling for rice cakes as a sub for bread in avocado toast &amp; shit of that nature. 🥲

@AquafabaMcGee The benefits: 
-adds iron to your food, which is tasty and nutritious. Especially important for vegans!
-the cast iron stays super hot, so it’s perfect for charring or quickly sautéing foods. It add a facet restaurant taste to veggies, faux meats, pizzas, biscuits, etc!

@WillPostTweets The sandwich 😂

Mine are:
🥺😈👀😡😘

@aroundthesun17 Send me a message if you have questions, I make pies all the time! 

My best advice is to keep the crust cold while you work with it &amp; be patient! Pies take a long time to assemble and bake sometimes. 

What kind are you making? 🙂

@plants_n_tings BMI is BS anyway! But I know you know that. 
For the record I think you look super healthy, you have a beautiful glow to your skin and your body is 🔥.
And I think it’s awesome that you plan to donate your eggs 🥰

@OhMyHades_ Yes I’ve had it on savory foods! 
(We basically do that on a lot of American foods except it’s called sour cream, which is like almost the same thing as unsweetened yogurt I think 🧐)

But a lot of people have sweet fruity flavors for breakfast 😋 so yummy

@Qwaid It’s actually so good and way healthier than a cow steak! 
A lot of vegans like the taste of meat and animal products but they don’t want to kill animals. so we have cauliflower “steaks” 
Ik it seems silly at first glance but there’s reasons why people like it! 😋

@QuayMatt Oh god where to begin with this...

First I’ll say composition is good and I also think the colors, especially on the skin tone are beautiful and objectively well done.

The horse seems to have a different light source than the rider. Also the perspective seems off.

@ir0nreagan Cw calories, weight

That’s all awful. I absolutely hate that so many restaurants here have calories on the menu, it’s awful. I’m so lucky it wasn’t like that when I was a teenager. 

None of these address any of the root causes why people struggle with their weight.🤦

@shinjiwannabe I‘be been so over tired the last couple days, I think I just forgot 😰
Now that you say that I do remember you sending me stuff.

&amp; Those sound dope!

@shinjiwannabe How did I not even know you play guitar? I feel like a bad friend 😅
Pedals are so fun though! What kinds did you get?
And I’m happy for you for making a new friend 🥰!! Good job!! It is so hard

